BEING VEGAN IS EASY
_
Nevertheless‚Ä¶ The question to ask ourselves should not be ‚ÄòIs it easy?‚Äô, nor ‚ÄòIs it convenient?‚Äô, but ‚ÄòIs it right?‚Äô
_
Being vegan happens to be far easier than many of our other moral duties and commitments, but the fact that some of us may find it inconvenient to replace the products of violence with vegan alternatives doesn‚Äôt absolve us of our obligation to do so. 
_
Living without harming others for a taste, a trinket, a thrill is not a personal choice. It‚Äôs simply the right thing to do.
_
Do everything you can to educate yourself about why you are making this change. Check out www.challenge 22.com
_
Read about it, learn about it, and keep reading and learning until you reach the point where the products of animal slavery no longer appeal to you.
_
Once you really understand the reasons for being vegan, there is no social challenge that will make you question your resolve, and no degree of pressure will cause you to be tempted to break your commitment. -www.befairbevegan.com
